Function SaveFilePathsFromFolder {
    param(
        [string]$file
    )
    # $domainName = "VCCollege"
    # $newFilePath = GetFilePathSplitAtDomainName "VCCollege" $file
    $getInitVars = GetInitialVariables
    $outputFilePathCompared = $getInitVars[3]
    # $newFileName = "C:\Users\vkimura\Downloads\6794_SampleCode-Data\OutputFilePathinFolderSplitURL"+$domainName+".txt"
    if (-not(Test-Path -Path $outputFilePathCompared -PathType Leaf)) {
        try {
            $null = New-Item -ItemType File -Path $outputFilePathCompared -Force -ErrorAction Stop
        }
        catch {
            throw $_.Exception.Message
        }
    }
    $arrMatchedFile = SearchInSpreadsheetForMatchingFile $file
    if ($arrMatchedFile[0] -eq "true" -Or $arrMatchedFile -eq "true") {
        $boolMatchedFile = "true"
    } elseif ($arrMatchedFile.count -gt 0) {
        $boolMatchedFile = "false"
    }
    $matchedInfo = $file,$boolMatchedFile
    WriteOutputToFile $outputFilePathCompared ($matchedInfo -join ",")
}

