Function WriteOutputToFile {
    # $filePath = "C:\Users\vkimura\Downloads\6794_SampleCode-Data\OutputFilePathinFolder.txt"
    param(
        [string]$filePath,
        [string]$content
    )
    # $content | Out-File -FilePath $filePath -Append
    Add-Content $filePath $content
}
Function GetFilePathSplitAtDomainName {
    param(
        [string]$domainName,
        [string]$filePath
    )
    $splitAtDomainName = $domainName
    $filePathArray = $filePath.Split([string[]]"$splitAtDomainName", [System.StringSplitOptions]::RemoveEmptyEntries)
    $lowerCased = ToLowerCase $filePathArray[1]
    $replaceSlashes = ReplaceBackSlashToForwardSlash $lowerCased
    return $replaceSlashes
    # $filePathArray[0..2] -join "\"
}
Function ToLowerCase {
    param(
        [string]$filePath
    )
    return $filePath.ToLower()
}
Function ReplaceBackSlashToForwardSlash {
    param(
        [string]$filePath
    )
    return $filePath.Replace("\", "/")
}
